import React from 'react'
import TextField from '@mui/material/TextField';
import '../App.css';
import Button from '@mui/material/Button';
import { Box } from '@mui/system';

const style = StyleSheet.create ({
  position: 'absolute',
  top: '50%',
  left: '50%',
  transform: 'translate(-50%, -50%)',
  width: 400,
  bgcolor: 'white',
  border: '2px solid #000',
  height: 200,
  padding: 3,
  shadowOffset: {
    width: 0,
    height: 2
  },
  shadowOpacity: 0.25,
  shadowRadius: 4,
  elevation: 5
}); 

export default function AddData({closeAddModal}) {
  return (
    <Box sx={{ ...style}}>
      <TextField id="demo-helper-text-misaligned-no-helper" label="Title" />
      <TextField id="demo-helper-text-misaligned-no-helper" label="Description" />
      <Button variant="contained" color="inherit">Add</Button>
      <Button variant="outlined" color="inherit" onClick={() => closeAddModal(false)}>Cancel</Button>
    </Box>
  )
}
